import React, { Component } from 'react';
import './App.css';
import './css/index.css';
import AppContent from './components/app-content';

class App extends Component {
  constructor() {
    super();
    this.state = {
      userinfo: 'aaa',
      repos: [],
    };
  }
  render() {
    return <AppContent userinfo={'Cu'} repos={this.state.repos} />;
  }
}

export default App;
